import React from 'react';
import './winner.scss';

const Winner = ({Xwin, Owin}) => {
    const victory = () => {
        if(Xwin === true) {
            return (
                '1(X)'
            )
        } else if(Owin === true) {
            return (
                '2(O)'
            )
        }
    }
    
    return(
        <div className='winner-container'><h1>Player {victory()} winning the game \o/ !</h1></div>
    )


}


export default Winner;
